<h2><a name='sect0' href='#toc0'>Name</a></h2>
<p>
Open MPI - General information
<h2><a name='sect1' href='#toc1'>Open Mpi</a></h2>
<p>
Open MPI is an open source
implementation of MPI (message-passing interface), the industry-standard
specification for writing message-passing programs. Message passing is a
programming model that gives the programmer explicit control over interprocess
communication. <p>
The MPI specification was developed by the MPI Forum, a group
of software developers, computer vendors, academics, and computer-science
researchers whose goal was to develop a standard for writing message-passing
programs that would be efficient, flexible, and portable. <p>
The outcome, known
as the MPI Standard, was first published in 1993; its most recent version
(MPI-3.1) was published in June 2015. Open MPI includes all MPI 3.1-compliant
routines. <p>
For more information about Open MPI, see <i>https://www.open-mpi.org.</i>
<p>
The MPI standards are available at <i>https://www.mpi-forum.org.</i>
<h2><a name='sect2' href='#toc2'>Man Page Syntax</a></h2>
<p>
Man
pages for Open MPI and Open MPI I/O routines are named according to C syntax,
that is, they begin with the prefix C]MPI_R], all in uppercase, and the
first letter following the C]MPI_R] prefix is also uppercase. The rest of
the letters in the routine are all lowercase, for example, C]MPI_Comm_get_attrR].

<h2><a name='sect3' href='#toc3'>Environment</a></h2>
<p>
To fine-tune your Open MPI environment, you can either use arguments
to the C]mpirunR] or C]mpiexecR] commands, or you can use MCA parameters.
<p>
For more information on arguments, see the C]mpirunR](1) man page. <p>
For a
complete listing of MCA parameters and their descriptions, issue the command
C]ompi_info --allR]. This information also appears in the FAQ on the Open
MPI web site at <i>https://www.open-mpi.org/faq/?category=tuning#mca-params.</i>
<h2><a name='sect4' href='#toc4'>Errors</a></h2>
<p>
All
MPI routines (except C]MPI_WtimeR] and C]MPI_WtickR]) return an error value;
C routines as the value of the function and Fortran routines in the last
argument. Before the value is returned, the current MPI error handler is
called. By default, this error handler aborts the MPI job. The error handler
may be changed with C]MPI_Comm_set_errhandlerR]; the predefined error handler
C]MPI_ERRORS_RETURNR] may be used to cause error values to be returned.
Note that MPI does not guarantee that an MPI program can continue past
an error. <p>
For more information on Open MPI error codes, see C]mpi.hR] in
the C]includeR] directory. <p>
